import React from 'react';
import './directory-header.style.css'


const DirectoryHeader = () => (
    <div className='DirectoryHeader_container'>
        <div className='DirectoryHeader_content'>
            <p className='DirectoryHeader_text'> ALL PRODUCTS INCLUDE ACTIVE INGREDIENTS</p>
            <p className='DirectoryHeader_text'> TO DELIVER RESULTS FOR YOU. </p>
        </div>
    </div>
);

export default DirectoryHeader;
